var canvas = document.getElementById("canvas");
var ctx = canvas.getContext("2d");

var grid = []

var square = 4;
var width = 1000;
var height = 700;

var up = [-1,0];
var down = [1,0];
var left = [0,-1];
var right = [0,1];
var directions = [up, down, left, right];
for (var i = 0; i < height/square; i ++) {
	var current = []
	for (var j = 0; j < width/square; j ++) {
		current.push(0);
	}
	grid.push(current);
}

class people {
	constructor(xyi, goali, colouri) {
		this.xy = xyi;
		this.goal = goali;	
		this.colour = colouri;
	}
	
	move (dir) {
		
		var dest = [this.xy[0] + dir[0], this.xy[1] + dir[1]]
		if (dest[0] < 0 || dest[0] >= height/square || dest[1] < 0 || dest[1] >= width/square) {
			return false;
			
		}
		if (grid[dest[0]][dest[1]]) {
			return false;
		}
	
		grid[dest[0]][dest[1]] = this;
		grid[this.xy[0]][this.xy[1]] = 0;
		
		
		this.xy[0] = dest[0];
		this.xy[1] = dest[1];
		
		return true;
	}
	
	moveSide () {
		if (this.xy[1] == this.goal[1]) {
			return false;
			
		} else if (this.xy[1]  >  this.goal[1]) {
			if (this.move(left)) {
				
				return true;
			}
		} else if (this.xy[1] < this.goal[1]) {
			if (this.move(right)) {
				
				return true;
			}
		}
		
	}
	moveVert () {
		if (this.xy[0] == this.goal[0]) {
			return false;
			
		} else if (this.xy[0]  >  this.goal[0]) {
			if (this.move(up)) {
				
				return true;
			}
			
			
		} else if (this.xy[0] < this.goal[0]) {
			
			if (this.move(down)) {
				return true;
			}
		
		}
		
	}
	
	turn () {
		var moved = false;
		if (Math.random() < 1) {
			
			if (!this.moveSide()) {
				if (this.moveVert()) {
					moved = true;
				};
				
			} else {
				
				moved = true;
			}
			
		} else {
			
			if (!this.moveVert()) {
				if (this.moveSide()) {
					moved = true;
				};
				
			} else {
				moved = true;
			}
			
		}
		if (!moved && (this.xy[0] != this.goal[0] ||this.xy[1] != this.goal[1] )) {
		
			/*for (var i = 0; i < 5; i ++) {
				if (this.move(directions[parseInt(Math.random() * 4)])) {
					
					return;
				}
				
			}
			*/
			
		}
		
	}
}

function draw() {
	for (var i = 0; i < height/square; i ++) {
		for (var j = 0; j < width/square; j ++) {
			
			
			if (grid[i][j]!= 0) {
				
				ctx.fillStyle = grid[i][j].colour;
				//ctx.fillStyle = 'black';
				
				ctx.fillRect(j * square, i * square,  square, square);
			}
			
		}
		
		
	}
	
	
	
}

